'''输入一个链表，输出该链表中倒数第k个结点。'''# -*- coding:utf-8 -*-class ListNode:    def __init__(self, x):        self.val = x        self.next = Noneclass Solution:    def FindKthToTail(self, head, k):        if k <= 0:            return None        last = head        for i in range(1, k):            if last == None:                break            last = last.next        if (last == None):            return None        first = head        while last.next != None:            first = first.next            last = last.next        return first        pass    pass